import React, { PureComponent } from 'react'
import { Redirect } from 'react-router'

export default class Home extends PureComponent {
    handleClick () {
        <Redirect to="/users"/>
    }


    render() {
        return (
            <div>
                <button handleClick={this.handleClick}>hello world</button>
            </div>
        )
    }
}
